var actor = "Lito";
ACTIONS.MESSAGE.STATIC(actor,

[
"$amigo, no entiendo como pudiste llegar a mi, de aquí no pasas ni de pokemon ni de vida."
]

,function(){


	ACTIONS.MESSAGE.CHOICE(actor, "Piensas también que yo he sido el culpable de toda esta magia y desastre?",
	[
		{text: "Creo que no",click: function () {

			ACTIONS.PROGRESS.SETNATURAL('creenlito'); 
		ACTIONS.MESSAGE.STATIC(actor,[
			"$amigo, con que no eres uno más del monton de Oka, te daré una batalla justa!",
			"$amigo!, si puedes vencerme te daré la medalla Bicho",
			],function(){

				ACTIONS.POKEMON.BATTLESTART(actor);

			});

		}},
		{text: "Claro que si!",click: function () { 

          ACTIONS.PROGRESS.SETNATURAL('nocreenlito'); 

			ACTIONS.MESSAGE.STATIC(actor,["$amigo, eres uno más del montón, creyendo todo con simples explicaciones!","En la vida nada es cuadrado y pienso que tienes que tener mucho cuidado","No ganarás"],function(){

				ACTIONS.POKEMON.BATTLESTART(actor);

			});

		}},
	]);


});

